import { unwrapResult } from '@reduxjs/toolkit'
import React from 'react'
import { useEffect } from 'react'
import { useState } from 'react'
import { useDispatch } from 'react-redux'
import FilterPanel from 'src/components/FilterPanel/FilterPanel'
import SearchItemResult from 'src/components/SearchItemResult/SearchItemResult'
import { getCategories } from './home.slice'
import * as S from './home.style'

export default function Home() {
  const [categoies, setCategories] = useState([])
  const dispatch = useDispatch()

  useEffect(() => {
    const getCate = async () => {
      const res = await getCategories()
      res.then(unwrapResult).then(res => setCategories(res.data))
    }
    getCate()
  }, [])

  return (
    <S.Container>
      <S.Side>
        <FilterPanel />
      </S.Side>
      <S.Main>
        <SearchItemResult />
      </S.Main>
    </S.Container>
  )
}
